import React from 'react';

export default function PokemonInfoModal(pokemon) {
  return (
    <div>
      <h3>{pokemon.name}</h3>
      <h3>{pokemon.weight}</h3>
      { 
      pokemon.sprites ? <img src={ pokemon.sprites.front_default } alt="" />
      : <p>loading image...</p> }
      { console.log(pokemon) }
    </div>
  );
}
